    false,nt"url": null,nt"notes": "Welcome to the NMFS NOAA Map Viewer. This
    is a quick navigation. In the toolbar, you see the options to:nu2022tView Legendnu2022tIdentifynu2022tPrint
    Mapnu2022tAdd Layersnu2022tChange Basemapnu2022tMeasure and Find Map Coordinatenu2022tShare
    Mapnu2022tFind LocationnThe Legend tool allows you to toggle through available layers
    of a map set (root layer). Within this, you can right click on a map set be able
    to zoom to the entire map set extent. If you right click on individual layer, you
    will be able to:nu2022tZoom to Layernu2022tExport Datanu2022tExport MetadatanThe
    Identify tool allows you to click on the map and see the results at that location
    of any visible layer. If multiple layers are visible, the popup result window will
    have a toggle option to see the other results.nThe Print Map tool gives you various
    options to export the map to a new window for printing.nThe Add Layers tool allows
    you to add or remove layers or remove layers from the map.nChange Basemap gives
    you the option to change the base maps on the map.nThe Measure tool will provide
    you with tool to determine the area, distance or location (coordinates) on the map.nShare
    tool will provide options to share by email, facebook, or twitter.nFind Location
    tool give you the ability to type in a city, address or standard location to zoom
    map at that location.n",nt"license_title": null,nt"extras": [{ntt"key":
